    "2015-02-04T19:38:50.881372",nt"name": "chicago-traffic-tracker-historical-congestion-estimates-by-region-a0e83",nt"isopen":
    false,nt"url": null,nt"notes": "This dataset contains the historical estimated
    congestion for the 29 traffic regions. The Chicago Traffic Tracker estimates traffic
    congestion on Chicagou2019s arterial streets (non-freeway streets) in real-time
    by continuously monitoring and analyzing GPS traces received from Chicago Transit
    Authority (CTA) buses. Two types of congestion estimates are produced every 10 minutes:
    1) by Traffic Segments and 2) by Traffic Regions or Zones. Congestion estimates
    by traffic segments gives observed speed typically for one-half mile of a street
    in one direction of traffic. Traffic Segment level congestion is available for about
    300 miles of principal arterials. Congestion by Traffic Region gives the average
    traffic condition for all arterial street segments within a region. A traffic region
    is comprised of two or three community areas with comparable traffic patterns. 29
    regions are created to cover the entire city (except Ou2019Hare airport area). There
    is much volatility in traffic segment speed. However, the congestion estimates for
    the traffic regions remain consistent for a relatively longer period. Most volatility
    in arterial speed comes from the very nature of the arterials themselves. Due to
    a myriad of factors, including but not limited to frequent intersections, traffic
    signals, transit movements, availability of alternative routes, crashes, short length
    of the segments, etc. Speed on individual arterial segments can fluctuate from heavily
    congested to no congestion and back in a few minutes. The segment speed and traffic
    region congestion estimates together may give a better understanding of the actual
    traffic conditions. Current estimates of traffic congestion by region are available
    at http://bit.ly/103beCf.",nt"license_title": "License Not Specified",nt"extras":
